Opisthosoma . Mottled olive­grey and centrally lighter, distinct darker heart mark in anterior half (
Fig. 1
); silver­grey setae which are very dense laterally, brown macrosetae less dense. Venter yellow­brown with large black patch covering ca. three quarter behind epigastric furrow. Spinnerets light brown.

