Distribution. Northern parts of Australia north of ca. 30 °S latitude (New South Wales , Northern Territory, Queensland, Western Australia ) (
Fig. 11
).

Life history and habitat preferences. Mature males and females were mainly collected from September to April, with single records for May and June. Male numbers peaked in October, females one month later in November. A female carrying spiderlings was collected in the Northern Territory in April ( WAM
T 58374
).

Knoelle clara


comb. nov.

appears to tolerate a variety of microhabitats, but seems to prefer sandy habitats near freshwater, such as creeks, springs or lakes. It has been found in open woodlands, for example amongst River Red Gum (

Eucalyptus camaldulensis

) or other eucalypts and 

Acacia

vegetation, such as Ironwood (

Acacia estrophiolata

), Needleleaf Wattle (

A. orthocarpa

), Ranji Bush (

A. pyrifolia

), or Mulga (

A. aneura

). Some records are from open grasslands, in particular from spinifex and tussock grasslands and buffel grass (

Cenchrus ciliaris

). In Queensland, 

Knoelle clara


comb. nov.

has been collected in sand dunes near beaches.
